prompt Creating ACCIDENT...
create table ACCIDENT
(
  accidentid     INTEGER not null,
  dateofaccident DATE not null,
  damagelevel    INTEGER not null
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table ACCIDENT
  add primary key (ACCIDENTID)
  using index 
  tablespace SYSTEM
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table ACCIDENT
  add constraint CHK_DAMAGE_LEVEL
  check (DamageLevel BETWEEN 1 AND 10);

